ナイーブ お風呂で使えるクレンジングオイル 250ml<br>ブランド：ナイーブ<br>販売・製造元：クラシエホームプロダクツ販売<br><br>オリーブオイル配合、濡れた手でも使えるクレンジングオイルです。<br>スピーディメイククリア処方で肌に負担をかけず、汚れを素早く洗い流します。<br>濡れた手でも使えるので、お風呂でしっかりメイクを落とせます。<br>マスカラや毛穴の汚れも一度ですっきり。<br>うるおい成分(ヒマワリ種子油)配合。<br> <br><br><br>使用方法<br>●手に適量(4プッシュ程度)を取り、円を描くようにして顔全体になじませ、汚れが浮き上がったら、水またはぬるま湯で洗い流してください。<br>●手や顔が非常に濡れている時は、軽く水気を切って使うことをおすすめします。<br>●容器の中に水が入らないようにご注意ください。<br> ご注意<br>●お肌に異常のある時、またはお肌に合わない時は、ご使用をおやめください。<br>●目に入らないように注意し、入ったときはすぐに洗い流してください。<br>●火気にご注意ください。<br> <br>成分<br>ミネラルオイル、パルミチン酸エチルヘキシル、トリイソステアリン酸PEG-20グリセリル、エチルヘキサン酸セチル、イソステアリン酸PEG-8グリセリル、テトライソステアリン酸ソルベス-30、オリーブ油、ヒマワリ種子油、水<br> 原産国日本 <br><br>お問い合わせ先<br>クラシエホームプロダクツ株式会社電話：(03)5446-3210 クレンジングオイルとはクレンジングオイルとは、メイクを落とす際に使う、オイルタイプのクレンジング剤のことです。<br>濡れた手でも使えるクレンジングオイルや、プラセンタ・ヒアルロン酸などの美容成分を含んだクレンジングオイルなど、様々なタイプのクレンジングオイルがあります。<br><br>化粧品／クレンジング・洗顔／クレンジング／クレンジングオイル<br>JANコード： 4901417601186<br><br>CS：36<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
