GUM(ガム) 歯間ブラシ L字型 (SS) 10本入り<br>ブランド：GUM(ガム)<br>販売・製造元：サンスター<br><br>ロングハンドルで握りやすく滑りにくい、六角形断面ハンドルを採用した歯間ブラシです。<br>余分な力を入れる事なくしっかり持てます。<br>奥歯の歯間部にも挿入しやすく、歯周病の原因となる歯間部の歯垢を効果的に除去します。<br>折れにくく曲がりにくい、高強度ワイヤーを採用。<br>ブラシ部の保護用のキャップ付き。<br>極細タイプ。<br>最小通過穴直径0.8-1.0mm。<br> <br><br>日用品／オーラルケア／歯石・歯垢対策／歯間ブラシ<br>JANコード： 4901616212022<br><br>CS：60<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
