メディッシュ薬用ハンドソープ ポンプ250ml<br>ブランド：メディッシュ<br>販売・製造元：牛乳石鹸共進社<br><br>3つの天然ハーブ(ローズヒップ・ローズマリー・セージ)、トリクロサンを配合。<br>小さなお子様とお母さんが一緒に使えるハンドソープです。<br>うるおいを保ちながらバイ菌を落とし、清潔なお肌に洗い上げます。<br>すすいだ後に手に香りが残らない、清潔感のあるシトラスの香り。<br>皮フアレルギーテスト済み(全ての方にアレルギーが起こらないという事ではありません)。<br>医薬部外品。<br> <br><br><br>使用方法<br>1、ネジキャップを右方向にしっかり締めながら、ノズルを左方向に回してください。<br>2、ポンプが上がったら、中身が出るまで数回空押ししてください。<br>あとは軽く押すだけで適量(約1ml)が出ます。<br> ご注意<br>●湿疹、皮ふ炎(かぶれ、ただれ)等、皮ふ障害のある時は、悪化させるおそれがありますので使用しないでください。<br>●かぶれたり、刺激を感じた時は使用を中止してください。<br>●目に入った時あ、すぐに洗い流してください。<br> 有効成分トリクロサン その他の成分ラウリン酸、ミリスチン酸、パルミチン酸、ヤシ油脂肪酸エタノールアミド、塩化K、ジステアリン酸グリコール、セージエキス、タイムエキス-2、ノバラエキス、ラベンダーエキスｰ1、ローズマリーエキス、香料、高重合PEG、PG、BG、水酸化K、EDTA ハンドソープ全部とはハンドソープは手指専用の洗浄料です。<br>手指の汚れを落とし、清潔な肌に整えます。<br><br>日用品／ハンドケア／ハンドソープ／ハンドソープ ポンプタイプ<br>JANコード： 4901525955706<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
