モイスタージュ エッセンスローション しっとり<br>ブランド：モイスタージュ<br>販売・製造元：クラシエホームプロダクツ販売<br><br>1本で化粧水と美容液の両方の役割を果たすローションです。<br>うるおいをたっぷり補給して、ハリと弾力のある肌に保ちます。<br>すぐれた保湿効果を持つ植物コラーゲン・スクワランに加え、シルクプロテインも配合しています。<br>美容液のようなしっとり感です。<br>210ml入り。<br> <br>シルク(セリシン) 化粧水 とはシルクは、蚕の繭からとれる天然たんぱく質で人間に必要不可欠なアミノ酸を大量に含む為、保湿効果に優れ、お肌をツルツルにケアし、化粧のノリも良くするというすぐれもの。<br>昔から「古来養蚕農家の方は年をとっても肌がつやつやでシミ一つない」といわれるのはシルクのパワーなのです。<br><br>化粧品／化粧水・ジェル／化粧水／保湿化粧水<br>JANコード： 4901417644305<br><br>CS：24<br>区分：化粧品<br>原産国：日本<br>発売元、製造元、輸入元又は販売元： クラシエホームプロダクツ販売<BR><BR>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
