リーチ 奥歯集中ケア コンパクト ふつう<br>ブランド：リーチ<br>販売・製造元：ジョンソン・エンド・ジョンソン<br><br>アングルネックが奥歯の奥までしかり歯垢を除去するコンパクト歯ブラシです。<br>歯ブラシの角度を付けて曲げることで、奥歯に届きやすくなっています。<br>奥歯までしっかり磨けるコンパクトヘッドを、一人一人にあった製品を選べるようサイズを展開。<br>ヘッドの形も先細形状で、奥歯の奥でも動かしやすくなっています。<br>親指のホームポジションに穴があいたユニークなデザイン。<br>毛先の向きを正確にコントロールでき、軽いので前後に動かしやすく、お口の奥の届きにくい場所でも安定したブラッシングが可能になりました。<br>長短2種類のブラシ毛が歯を包み込み、丸くカーブした奥歯の脇もしっかりケア。<br>※お届けする色は、ピンク・オレンジ・ブルー・グリーンのどれかになります。<br>色は選べませんので予めご了承下さい。<br> <br>ご注意<br>毛先がひらいたらとりかえましょう。<br> 品質表示●柄の材質：ポリプロピレン●毛の材質：ナイロン●毛の硬さ：ふつう●耐熱温度：80度<br> 原産国タイ <br><br>お問い合わせ先<br>ジョンソン・エンド・ジョンソン株式会社お客様相談室 0120-101110 <br>日用品／オーラルケア／歯ブラシ／コンパクト歯ブラシ<br>JANコード： 4901730090131<br><br>CS：120<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
